// Simular entrada del chatbot interno
// Puedes modificar este mensaje para probar diferentes comandos
const testMessages = [
  "ejecuta una prueba de análisis de datos",
  "quiero probar el procesamiento de documentos", 
  "corre la prueba de gestión de roles",
  "prueba la integración con APIs",
  "help",
  "status",
  "histórico"
];

// Seleccionar mensaje (puedes cambiar el índice o hacer random)
const selectedMessage = testMessages[0]; // Cambia el índice para probar diferentes mensajes

// También puedes usar un mensaje personalizado:
// const selectedMessage = "tu mensaje personalizado aquí";

const userId = 'n8n_internal_user';
const sessionId = `n8n_session_${Date.now()}`;

console.log(`🤖 Simulando chatbot con mensaje: "${selectedMessage}"`);

return {
  original_message: selectedMessage,
  clean_message: selectedMessage.toLowerCase().trim(),
  user_id: userId,
  session_id: sessionId,
  timestamp: new Date().toISOString(),
  message_length: selectedMessage.length,
  source: 'n8n_internal'
};

// Parse AI response and extract intent
const aiResponse = $json.message?.content || $json.choices?.[0]?.message?.content || '';
const originalInput = $('Simulate Chat Input').item.json;

let parsedResponse = {};
try {
  // Try to parse JSON response from AI
  parsedResponse = JSON.parse(aiResponse);
} catch (error) {
  console.error('Failed to parse AI response:', error);
  // Fallback parsing
  parsedResponse = {
    intent: 'unknown',
    test_case: null,
    parameters: null,
    confidence: 0.0,
    response_message: 'No pude entender tu solicitud. ¿Puedes ser más específico?',
    needs_clarification: true
  };
}

// Validate required fields
if (!parsedResponse.intent) parsedResponse.intent = 'unknown';
if (typeof parsedResponse.confidence !== 'number') parsedResponse.confidence = 0.5;
if (!parsedResponse.response_message) parsedResponse.response_message = 'Procesando tu solicitud...';

// Add metadata
parsedResponse.original_message = originalInput.original_message;
parsedResponse.user_id = originalInput.user_id;
parsedResponse.session_id = originalInput.session_id;
parsedResponse.timestamp = new Date().toISOString();
parsedResponse.source = originalInput.source;

console.log(`🎯 AI Intent parsed: ${parsedResponse.intent} (confidence: ${parsedResponse.confidence})`);
if (parsedResponse.test_case) {
  console.log(`📋 Test case identified: ${parsedResponse.test_case}`);
}

return parsedResponse;

